guides/getting-started.html.body:
시작하기
설치
vue-test-utils를 빠르게 맛보려면 제공하는 기본적인 설정이 되어있는 데모 저장소를 클론하세요.
git clone https://github.com/vuejs/vue-test-utils-getting-started
cd vue-test-utils-getting-started
npm install

프로젝트에 포함된 간단한 예제 컴포넌트인 counter.js를 볼 수 있습니다.
// counter.js

export default {
  template: `

      {{ count }}
      Increment

  `,

  data () {
    return {
      count: 0
    }
  },

  methods: {
    increment () {
      this.count++
    }
  }
}

컴포넌트 마운팅
vue-test-utils는 Vue Component를 독립적으로 마운팅하고, 필요한 것들(props, injections, 사용자 이벤트)을 목킹(mocking)할 수 있고 결과(렌더링된 결과, 방출된 커스텀 이벤트)를 검증할 수 있습니다.
마운트된 컴포넌트는 Wrapper 내부에 반환됩니다. 래퍼는 컴포넌트 내부를 조회, 탐색, 조작 등을 할 수 있는 여러가지 유용한 메소드 지원합니다.
래퍼를 만들기 위해 mount 메소드를 사용합니다. 이제, test.js 파일을 만드세요
// test.js

// mount() 메소드를 테스트 유틸에서 임포트합니다.
// 그리고 테스트할 컴포넌트를 가져옵니다.

import { mount } from 'vue-test-utils'
import Counter from './counter'

// 컴포넌트를 마운트하여 래퍼를 얻습니다.
const wrapper = mount(Counter)

// 실제 Vue 인스턴스는 wrapper.vm로 접근할 수 있습니다.
const vm = wrapper.vm

// 콘솔 로그를 사용해 래퍼의 내부를 살펴볼 수 있습니다.
// 이제 vue-test-utils와 함께 모험을 시작하세요
console.log(wrapper)

컴포넌트에서 렌더링 된 HTML 출력 테스트
래퍼를 얻었으니 처음으로 할 일은 컴포넌트가 렌더링한 HTML이 예상하는 것과 같은지 살펴봅니다.
import { mount } from 'vue-test-utils'
import Counter from './counter'

describe('Counter', () => {
  // 컴포넌트를 마운트하여 래퍼를 얻습니다.
  const wrapper = mount(Counter)

  it('renders the correct markup', () => {
    expect(wrapper.html()).toContain('0')
  })

  // 엘리먼트 유무를 확인하는 것도 쉽습니다.
  it('has a button', () => {
    expect(wrapper.contains('button')).toBe(true)
  })
})

npm test를 실행하면 테스트를 통과한 것을 볼 수 있습니다.
사용자 조작 시뮬레이션
우리의 카운터는 사용자가 버튼을 누르면 증가해야합니다. 이 행동을 시뮬레이션 하려면, 가장 먼저 wrapper.find()를 사용 해 버튼의 위치를 찾아야 합니다. 그러면 버튼 엘리먼트의 래퍼를 반환합니다. .trigger()를 이용하여 버튼 클릭을 시뮬레이션 합니다.
it('button click should increment the count', () => {
  expect(wrapper.vm.count).toBe(0)
  const button = wrapper.find('button')
  button.trigger('click')
  expect(wrapper.vm.count).toBe(1)
})

nextTick은 어떻게 할까요?
Vue는 DOM 업데이트를 미루고 비동기적으로 한번에 배치 처리하기 때문에, 여러번의 데이터 변이로 발생하는 불필요한 재 렌더링을 방지합니다. 실제로 상태가 변경된 후, Vue는 실제 DOM을 갱신을 미루고 기다리고 있습니다. 따라서 Vue.nextTick을 사용하지 않으면 처리 순서에 따라 업데이트 된 데이터를 바로 볼 수 없습니다.
하지만 테스트를 쉽게 하기 위해 vue-test-utils는 모든 업데이트를 동기적으로 반영하므로, DOM 업데이트가 반영되는것을 기다리기 위해 Vue.nextTick을 사용할 필요가 없습니다.
주의: 비동기 콜백이나 Promise같은 작업을 위해, 명시적으로 이벤트 루프를 이용해야할 경우, 아직은 nextTick이 필요합니다.
만약 당신이 테스트 파일에서 nextTick를 사용하는 하는 경우, 프로미스 내부에서 발생하는 오류는 테스트 러너가 잡아낼 수 없다는 것을 알아둬야 합니다.
이걸 피하려면, 두가지 접근방법이 있습니다. 테스트를 시작할 때, done콜백을 전역 에러 핸들러로 감싸거나, 인자가 없는 nextTick을 호출해서 프로미스로 리턴받을 수 있습니다.:
// 테스트에 잡히지 않는 경우.
it('잡아내지 못하고 지나갑니다.', (done) => {
  Vue.nextTick(() => {
    expect(true).toBe(false)
    done()
  })
})

// 테스트가 되는 두가지 케이스.
it('done을 이용해서 에러를 잡을 것 입니다.', (done) => {
  Vue.config.errorHandler = done
  Vue.nextTick(() => {
    expect(true).toBe(false)
    done()
  })
})

it('프로미스를 이용해서 오류를 잡을 것 입니다.', () => {
  return Vue.nextTick()
    .then(function () {
      expect(true).toBe(false)
    })
})

앞으로 해야할 일은

[테스트 러너 선택]하고 vue-test-utils을 프로젝트에 추가하세요
테스트를 작성하는데 필요한 기본적인 테크닉을 살펴보세요

guides/common-tips.html.body:
일반적인 팁
어떤것을 테스트해야 할까요
UI 컴포넌트의 경우, 내부 구현에 집중하다 보면 너무 많은 내부 구현을 살펴보아야 하기 때문에, 테스트 작성에 소홀하게 되어 나중에는 테스트가 어렵습니다. 그래서 코드 한 줄 한 줄을 모두 테스트하는 것을 추천하지 않습니다.
대신, 컴포넌트 퍼블릭 인터페이스를 확인하는 테스트를 작성하는 것을 추천합니다. 그리고 내부를 블랙박스로 취급해야 합니다. 하나의 테스트 케이스는 컴포넌트에 전달된 일부 입력 (사용자 인터렉션 또는 props 변경)이 예상되는 대로 출력(렌더링 된 결과 또는 방출된 사용자 정의 이벤트)되는지 확인 해야합니다.
예를 들어 버튼을 클릭할 때마다 카운터를 1씩 증가하는 Counter 컴포넌트의 경우, 해당 테스트 케이스가 클릭을 시뮬레이션하고, 렌더링 된 출력이 1씩 증가했음을 검증합니다. 이 테스트에서는 구현 방식은 생각하지 않고, 카운터의 값을 증가시키는 입력과 출력만 고려합니다.
이 접근 방식의 장점은 컴포넌트의 퍼블릭 인터페이스가 동일하게 유지되는 한 컴포넌트 내부 구현이 어떻게 변경되더라도 테스트가 통과된다는 것입니다.
이 주제는 Matt O'Connell의 훌륭한 발표를 확인하세요
얕은(Shallow) 렌더링
유닛 테스트에서, 보통 컴포넌트를 독립된 단위로 격리시켜 간접적으로 자식 컴포넌트의 동작을 실행하는 것을 피합니다.
이에 더하여, 많은 자식 컴포넌트를 가진 컴포넌트는 렌더링 된 트리 전체가 커질 수 있습니다. 반복적으로 모든 자식 컴포넌트를 렌더링하면 테스트 속도가 느려질 수 있습니다.
vue-test-utils는 shallow 메소드를 이용해 자식 컴포넌트를 렌더링하지 않고 (스텁으로) 컴포넌트를 마운트할 수 있게 합니다.
import { shallow } from 'vue-test-utils'

const wrapper = shallow(Component) // 마운트된 컴포넌트 인스턴트를 포함한 래퍼를 반환
wrapper.vm // 마운트된 Vue 인스턴스

방출된 이벤트 검증
마운트된 각 래퍼는 자동으로 Vue 인스턴스에 의해 생성된 모든 이벤트를 기록합니다. wrapper.emitted() 메소드를 사용해 기록된 이벤트를 검색할 수 있습니다.
wrapper.vm.$emit('foo')
wrapper.vm.$emit('foo', 123)

/*
wrapper.emitted() 는 다음 객체를 반환합니다.
{
  foo: [[], [123]]
}
*/

그런 다음 위 데이터 기반으로 검증할 수 있습니다.
import { expect } from 'chai'

// 방출된 이벤트 검증
expect(wrapper.emitted().foo).toBeTruthy()

// 이벤트 갯수 검증
expect(wrapper.emitted().foo.length).toBe(2)

// 이벤트 페이로드 검증
expect(wrapper.emitted().foo[1]).toEqual([123])

wrapper.emittedByOrder()를 호출하여 이벤트 배열을 방출될 순서대로 가져올 수 있습니다.
컴포넌트 상태 조작
래퍼에서 setData 또는 setProps 메소드를 사용하여 컴포넌트 상태를 직접 조작할 수 있습니다.
wrapper.setData({ count: 10 })

wrapper.setProps({ foo: 'bar' })

Props 목킹
Vue에 내장된 propsData 옵션을 이용해 컴포넌트에 props에 전달할 수 있습니다.
import { mount } from 'vue-test-utils'

mount(Component, {
  propsData: {
    aProp: 'some value'
  }
})

이미 마운트 된 컴포넌트의 props를 갱신하려면 wrapper.setProps({})을 이용합니다.
전체 옵션은 문서의 마운트 옵션을 확인하세요
글로벌 플러그인과 믹스인 적용
일부 컴포넌트는 글로벌 플러그인 또는 믹스인에 의존한 기능이 있을 수 있습니다. 예를 들어 vuex와 vue-router가 있습니다.
특정 앱의 컴포넌트에 대한 테스트를 작성하는 경우 동일한 글로벌 플러그인과 믹스인을 테스트 항목에 한번만 설정할 수 있습니다. 그러나 일부 앱에서 공유할 수 있는 일반적인 컴포넌트들을 테스트하는 경우에는 글로벌 Vue 생성자를 오염시키지 않고 격리시켜 컴포넌트를 테스트하는 것이 좋습니다. createLocalVue 메소드를 사용해 다음과 같이 할 수 있습니다.
import { createLocalVue } from 'vue-test-utils'

// 확장된 Vue 생성자를 만듭니다.
const localVue = createLocalVue()

// 일반적으로 사용하듯 플러그인을 설치합니다.
localVue.use(MyPlugin)

// 마운트 옵션에 localVue를 전달합니다.
mount(Component, {
  localVue
})

인젝션 목킹
간단하게 모의 속성을 주입하는 또 다른 방법은, mocks 옵션을 이용해 목킹하면 됩니다.
import { mount } from 'vue-test-utils'

const $route = {
  path: '/',
  hash: '',
  params: { id: '123' },
  query: { q: 'hello' }
}

mount(Component, {
  mocks: {
    $route // 컴포넌트를 마운트하기 전에 목킹된 $route 객체를 Vue 인스턴스에 추가합니다.
  }
})

라우팅 다루기
정의를 이용한 라우팅은 전반적인 앱 구조와 여러 컴포넌트와 관련되므로 통합 또는 엔드-투-엔드 테스트에서 가장 잘 테스트 할 수 있습니다. vue-router 기능에 의존하는 개별 컴포넌트의 경우, 위의 방법을 사용하여 목킹할 수 있습니다.

guides/dom-events.html.body:
마우스, 키 그리고 기타 DOM 이벤트 테스팅
이벤트 트리거
Wrapper는 trigger 메소드를 노출합니다. 이 메소드로 DOM 이벤트를 트리거(발생하게)합니다.
const wrapper = mount(MyButton)

wrapper.trigger('click')

find를 이용하면, 리턴값이 래퍼가 돌아온다는 것을 알고 있어야 합니다. MyComponent속에 버튼이 포함되어 있다고 가정하면 다음 코드가 버튼을 클릭을 발생시킵니다.
const wrapper = mount(MyComponent)

wrapper.find('button').trigger('click')

옵션
트리거 메소드는 선택적으로 options 객체를 가질 수 있습니다. 이 options 객체의 속성이 이벤트에 추가됩니다.
const wrapper = mount(MyButton)

wrapper.trigger('click', { button: 0 })

마우스 클릭 예제
테스트할 컴포넌트


  Yes
  No



export default {
  name: 'YesNoComponent',
  props: {
    callMe: {
      type: Function
    }
  },
  methods: {
    callYes() {
      this.callMe('yes')
    },
    callNo() {
      this.callMe('no')
    }
  }
}


테스트
import YesNoComponent from '@/components/YesNoComponent'
import { mount } from 'vue-test-utils'
import sinon from 'sinon' // sinon.js

describe('Click event', () => {
  it('Click on yes button calls our method with argument "yes"', () => {
    const spy = sinon.spy()
    const wrapper = mount(YesNoComponent, {
      propsData: {
        callMe: spy
      }
    })
    wrapper.find('button.yes').trigger('click')

    spy.should.have.been.calledWith('yes')
  })
})

키보드 예제
테스트할 컴포넌트
이 컴포넌트는 다양한 키조작으로 증감을 처리합니다.




const KEY_DOWN = 40
const KEY_UP = 38
const ESCAPE = 27
const CHAR_A = 65

export default {
  data() {
    return {
      quantity: 0
    }
  },
  methods: {
    increment() {
      this.quantity += 1
    },
    decrement() {
      this.quantity -= 1
    },
    clear() {
      this.quantity = 0
    },
    onKeydown(e) {
      if (e.keyCode === ESCAPE) {
        this.clear()
      }
      if (e.keyCode === KEY_DOWN) {
        this.decrement()
      }
      if (e.keyCode === KEY_UP) {
        this.increment()
      }
      if (e.which === CHAR_A) {
        this.quantity = 13
      }
    }
  },
  watch: {
    quantity: function (newValue) {
      this.$emit('input', newValue)
    }
  }
}


Test
import QuantityComponent from '@/components/QuantityComponent'
import { mount } from 'vue-test-utils'

describe('Key event tests', () => {
  it('Quantity is zero by default', () => {
    const wrapper = mount(QuantityComponent)
    expect(wrapper.vm.quantity).to.equal(0)
  })

  it('Cursor up sets quantity to 1', () => {
    const wrapper = mount(QuantityComponent)
    wrapper.trigger('keydown.up')
    expect(wrapper.vm.quantity).to.equal(1)
  })

  it('Cursor down reduce quantity by 1', () => {
    const wrapper = mount(QuantityComponent)
    wrapper.vm.quantity = 5
    wrapper.trigger('keydown.down')
    expect(wrapper.vm.quantity).to.equal(4)
  })

  it('Escape sets quantity to 0', () => {
    const wrapper = mount(QuantityComponent)
    wrapper.vm.quantity = 5
    wrapper.trigger('keydown.esc')
    expect(wrapper.vm.quantity).to.equal(0)
  })

  it('Magic character "a" sets quantity to 13', () => {
    const wrapper = mount(QuantityComponent)
    wrapper.trigger('keydown', {
      which: 65
    })
    expect(wrapper.vm.quantity).to.equal(13)
  })
})

제한 사항
keydown.up 처럼, 점 뒤에 있는 키 이름은 keyCode로 반환됩니다. 현재 다음 이름들만 지원하고 있습니다.

enter, tab, delete, esc, space, up, down, left, right

중요
vue-test-utils는 이벤트를 동기적으로 트리거 합니다. 따라서, Vue.nextTick은 필요하지 않습니다.

guides/testing-SFCs-with-jest.html.body:
Jest로 싱글 파일 컴포넌트 테스트

이 설정의 예제는 GitHub에 있습니다.

Jest는 페이스북이 개발한 테스트 러너입니다. 잘 갖춰진 유닛 테스팅 솔루션을 목표로 합니다. 자세한 내용은 Jest의 공식 문서를 살펴보세요.
Jest 설정
이미 webpack, vue-loader 및 Babel이 올바르게 설정했다고 가정합니다. vue-cli로 스캐폴딩된 webpack-simple 템플릿을 사용합니다.
가장 먼저 할 일은 Jest와 vue-test-utils를 설치하는 것 입니다.:
$ npm install --save-dev jest vue-test-utils

다음은 package.json에서 스크립트 하나를 추가합니다.
// package.json
{
  "scripts": {
    "test": "jest"
  }
}

Jest로 싱글 파일 컴포넌트 처리
Jest에게 *.vue 파일을 처리하는 방법을 알려주기 위해, vue-jest 프리프로세서를 설치하고 설정해야합니다.:
npm install --save-dev vue-jest

다음으로 jest 블럭을 package.json에 추가합니다.:
{
  // ...
  "jest": {
    "moduleFileExtensions": [
      "js",
      "json",
      // Jest가 *.vue 파일을 처리할 수 있도록 합니다.
      "vue"
    ],
    "transform": {
      // vue-jest로 *.vue 파일을 처리합니다.
      ".*\\.(vue)$": "/node_modules/vue-jest"
    },
    "mapCoverage": true
  }
}


참고: vue-jest는 현재 사용자 정의 블럭 및 스타일 로딩과 같은 vue-loader의 모든 기능을 지원하지는 않습니다. 또한, 코드 분할과 같은 일부 webpack 관련 기능은 지원하지 않습니다. 이를 사용하려면, Mocha + webpack로 싱글 파일 컴포넌트 테스트를 읽어보세요.

webpack 알리아스 다루기
webpack 설정에서 @를 /src로 지정한 알리아스(별칭)를 사용하는 경우, Jest가 알 수 있도록 moduleNameMapper 옵션을 사용하여 맞추는 설정을 추가해야 합니다.
{
  // ...
  "jest": {
    // ...
    // @를 src로 매핑합니다.
    "moduleNameMapper": {
      "^@/(.*)$": "/src/$1"
    }
  }
}

Jest를 위한 Babel 설정
Node의 최신 버전이 이미 대부분의 ES2015 기능을 지원하지만 테스트에서 ES 모듈 문법 및 stage-x 기능을 사용하길 원할 수 있습니다. 이를 위해 babel-jest를 설치해야합니다.:
npm install --save-dev babel-jest

다음으로 Jest에게 babel-jest로 JavaScript 테스트 파일을 처리하도록 package.json에 jest.transform 아래에 엔트리를 추가하여 알려줄 필요가 있습니다.:
{
  // ...
  "jest": {
    // ...
    "transform": {
      // ...
      // babel-jest로 js를 처리한다.
      "^.+\\.js$": "/node_modules/babel-jest"
    },
    // ...
  }
}


기본적으로 babel-jest는 설치 되어있는 한 자동으로 설정됩니다. 그러나 앞서 *.vue 파일에 대한 변환을 명시적으로 추가했으므로 이제 babel-jest도 명시적으로 구성해야 합니다.

webpack에서 babel-preset-env를 사용한다고 가정하면, webpack은 이미 ES 모듈을 처리하는 방법을 알고 있기 때문에 Babel 설정은 ES 모듈 트랜스파일을 비활성화합니다. 그러나 Jest 테스트는 Node에서 직접 실행되기 때문에, 테스트를 위해 이것을 활성해야 합니다.
또한 babel-preset-env에 현재 사용하고 있는 Node 버전을 알려줄 수도 있습니다. 이렇게 하면 불필요한 기능을 건너뛰고 테스트가 더 빨리 시작됩니다.
이 옵션을 테스트에만 적용하려면, env.test (babel-jest를 통해 자동으로 선택)를 아래 설정에 넣으세요.
.babelrc 예제:
{
  "presets": [
    ["env", { "modules": false }]
  ],
  "env": {
    "test": {
      "presets": [
        ["env", { "targets": { "node": "current" }}]
      ]
    }
  }
}

스냅샷 테스트
vue-server-renderer를 사용해 컴포넌트를 문자열로 렌더링하여 Jest 스냅샷 테스트를 위한 스냅샷으로 제공할 수 있습니다.
vue-server-renderer의 렌더링 결과 만으로는 몇개의 SSR 특정 속성을 포함하여 공백 같은 문자열을 무시하므로, diff 부분을 찾아내기가 좀 어렵습니다. 사용자 정의 시리얼라저(custom serializer)를 사용해, 저장된 스냅샷을 개선할 수 있습니다.:
npm install --save-dev jest-serializer-vue

package.json 설정:
{
  // ...
  "jest": {
    // ...
    // 스냅샷을 위한 시리얼라이저
    "snapshotSerializers": [
      "/node_modules/jest-serializer-vue"
    ]
  }
}

테스트 파일 배치
기본적으로 Jest는 전체 프로젝트에서 .spec.js 또는 .test.js 확장자를 갖는 모든 파일을 재귀적으로 선택합니다. 이것이 상황에 맞지 않으면 package.json 파일의 config 섹션에서 testRegex를 변경할 수 있습니다.
Jest는 테스트중인 코드 바로 다음에 __tests__ 디렉터리를 만들 것을 권장 하지만, 테스트 결과를 적절히 마음대로 구조화할 수 있습니다. Jest는 스냅샷 테스트를 수행하는 파일 옆에 __snapshots__ 디렉터리를 만듭니다.
스펙 예제
Jasmine에 익숙하면 Jest의 assertion API를 사용해 편하게 사용할 수 있습니다.
import { mount } from 'vue-test-utils'
import Component from './component'

describe('Component', () => {
  test('is a Vue instance', () => {
    const wrapper = mount(Component)
    expect(wrapper.isVueInstance()).toBeTruthy()
  })
})

