guides/testing-SFCs-with-mocha-webpack.h.body:
Mocha + webpack로 싱글 파일 컴포넌트 테스트

이 설정의 예제는 GitHub에 있습니다.

싱글 파일 컴포넌트를 테스트하기 위한 또 다른 전략은 webpack을 통해 모든 테스트를 컴파일한 다음 테스트 러너에서 실행하는 것 입니다. 이 접근 방식의 장점은 모든 webpack 및 vue-loader 기능을 완벽히 지원하므로 소스코드를 테스트에 타협하지 않아도 된다는 점 입니다.
기술적으로 테스트 러너를 사용해 수동으로 연결 할 수 있으나, 특정 작업에 매우 유용한 mocha-webpack이 있습니다.
mocha-webpack 설정
이미 webpack, vue-loader 및 Babel이 올바르게 구성되어 있는 것으로 시작한다고 가정합니다. vue-cli에 의해 스캐폴딩된 webpack-simple템플릿을 사용합니다.
가장 먼저 할 일은 테스트 종속성을 설치하는 것 입니다.:
npm install --save-dev vue-test-utils mocha mocha-webpack

다음은 package.json에서 스크립트 하나를 추가합니다.:
// package.json
{
  "scripts": {
    "test": "mocha-webpack --webpack-config webpack.config.js --require test/setup.js test/**/*.spec.js"
  }
}

몇가지 참고해야 할 주의사항이 있습니다.:

--webpack-config 플래그는 테스트에 사용할 webpack 설정을 지정합니다. 대부분의 경우 이 설정은 실제 프로젝트에 사용하는 설정과 동일하지만, 작은 수정을 하려합니다. 나중에 이것을 다룰 것입니다.

--require 플래그는 테스트 전에 test/setup.js가 실행되도록 합니다. 테스트가 실행될 글로벌 환경을 설정할 수 있습니다.

마지막 전달 인자는 모든 테스트 파일의 집합(glob) 입니다.


추가 webpack 설정
NPM 의존성 외부화
우리는 테스트를 하면서 다양한 NPM 의존성을 가져오게 되는 경우가 많이 있습니다. - 이 모듈 중 일부는 브라우저 사용을 염두하고 작성되어 있는 것 도 있기에, 단순하게 webpack으로 패키지 하기엔 적합하지 않습니다. 또 다른 고려사항으로는 의존성을 외부화 하게 되면, 테스트 시작 속도를 크게 향상시킬 수 있습니다. webpack-node-externals을 사용하여 모든 NPM 의존성을 외부화할 수 있습니다.:
// webpack.config.js
const nodeExternals = require('webpack-node-externals')

module.exports = {
  // ...
  externals: [nodeExternals()]
}

소스맵
소스맵은 mocha-webpack에 의해서 포착 될 수 있게 하기 위해, in-line화 할 필요가 있습니다. 권장 설정은 다음과 같습니다.:
module.exports = {
  // ...
  devtool: 'inline-cheap-module-source-map'
}

IDE를 통해 디버깅하는 경우, 다음을 추가하는 것이 좋습니다.:
module.exports = {
  // ...
  output: {
    // ...
    // 소스맵에 절대 경로 사용 (IDE를 통한 디버깅에서 중요함)
    devtoolModuleFilenameTemplate: '[absolute-resource-path]',
    devtoolFallbackModuleFilenameTemplate: '[absolute-resource-path]?[hash]'
  }
}

브라우저 환경 설정
vue-test-utils를 실행하려면, 브라우저 환경이 필요합니다. Node.js에서 jsdom-global를 이용해 시뮬레이션합니다.:
npm install --save-dev jsdom jsdom-global

test/setup.js에 추가합니다.:
require('jsdom-global')()

이는 vue-test-utils가 올바르게 동작할 수 있도록 브라우저 환경을 노드에 추가합니다.
검증(Assertion) 라이브러리 선택
Chai는 Mocha와 함께 사용하는 인기있는 검증 라이브러리입니다. 스파이와 스텁을 만드는 방법에 대해 Sinon에서 확인하세요.
대안으로 Jest의 일부인 expect를 사용할 수 있으며, Jest 문서에서 정확히 같은 API를 노출합니다.
여기서 expect를 사용하여 글로벌로 사용할 수 있도록 만들어, 모든 테스트에서 임포트할 필요는 없습니다.:
npm install --save-dev expect

test/setup.js입니다.
require('jsdom-global')()

global.expect = require('expect')

테스트를 위한 Babel 최적화
JavaScript를 처리하기 위해 babel-loader를 사용하고 있습니다. 앱에서 Babel을 쓰시는 경우, .babelrc 파일이 이미 구성 되어 있을 것입니다. 만약 당신이 별도로 구성하지 않는다면, babel-loader는 자동으로 같은 설정 파일을 가져오게 됩니다.
주의 해야 할 한가지는, 이미 ES2015 기능을 대부분 지원하는 Node 6+를 사용하는 경우에 별도의 Babel env 옵션을 설정할 수 있습니다. (예: stage-2 또는 미구현 된 flow 구문을 사용할 수 있도록 지원 등)
테스트 추가
src에 Counter.vue 파일을 만듭니다.:


      {{ count }}
      Increment




export default {
  data () {
    return {
      count: 0
    }
  },

  methods: {
    increment () {
      this.count++
    }
  }
}


다음 test/Counter.spec.js 파일을 만들고 아래 내용으로 테스트를 작성하세요.:
import { shallow } from 'vue-test-utils'
import Counter from '../src/Counter.vue'

describe('Counter.vue', () => {
  it('increments count when button is clicked', () => {
    const wrapper = shallow(Counter)
    wrapper.find('button').trigger('click')
    expect(wrapper.find('div').text()).toMatch('1')
  })
})

이제 테스트를 할 수 있습니다.:
npm run unit
테스트가 실행됩니다!
리소스

위 설정의 예제
Mocha
mocha-webpack
Chai
Sinon
jest/expect

guides/using-with-vue-router.html.body:
Vue Router 사용하기
테스트에 Vue Router 설치
테스트 할때 Vue 기반 생성자에 Vue Router를 설치하면 안됩니다. Vue Router를 설치하면 Vue prototype에 읽기 전용 속성으로 $route, $router가 추가됩니다.
이를 피하기 위해, localVue를 만들고 여기에 Vue Router를 설치합니다.
import VueRouter from 'vue-router'
const localVue = createLocalVue()

localVue.use(VueRouter)

shallow(Component, {
  localVue
})

router-link 또는router-view를 사용하는 테스트 컴포넌트
Vue Router를 설치하면 router-link와 router-view 컴포넌트가 등록됩니다. 즉, 임포트할 필요 없이 앱 어디서나 사용할 수 있습니다.
테스트를 실행할 때 컴포넌트에서 vue-router 관련 컴포넌트를 사용할 수 있도록 해야합니다. 이 방법에는 두가지가 있습니다.
스텁 사용하기
shallow(Component, {
  stubs: ['router-link', 'router-view']
})

localVue에 Vue Router 설치
import VueRouter from 'vue-router'
const localVue = createLocalVue()

localVue.use(VueRouter)

shallow(Component, {
  localVue
})

$route와 $router 목킹
때로는 컴포넌트가 $route와 $router 객체의 매개변수로 무언가를 수행하고 있는지 테스트를 할 필요가 있습니다. 이를 위해 사용자 정의 목(mocks-가짜데이터)을 Vue 인스턴스에 전달해야합니다.
const $route = {
  path: '/some/path'
}

const wrapper = shallow(Component, {
  mocks: {
    $route
  }
})

wrapper.vm.$router // /some/path

공통적으로 확인 할 주의사항
Vue Router를 설치하면 Vue prototype에 읽기 전용 속성으로 $route, $router가 추가됩니다.
이는 $route 또는 $router를 목킹하려고 시도하는 모든 테스트가 실패하는 것을 의미합니다.
이를 피하려면, 테스트를 실행하는 동안에는 Vue Router를 설치하지 마십시오.

guides/using-with-vuex.html.body:
Vuex 사용하기
이번에는 vue-test-utils와 함께, 컴포넌트에서 Vuex를 테스트하는 방법을 알아봅니다.
액션 목킹하기
약간의 코드를 살펴보겠습니다.
이 컴포넌트는 테스트가 필요합니다. Vuex의 액션을 호출하고 있습니다.



      Click




import { mapActions } from 'vuex'

export default{
  methods: {
    ...mapActions([
      'actionClick'
    ]),
    actionInputIfTrue: function actionInputIfTrue (event) {
      const inputValue = event.target.value
      if (inputValue === 'input') {
        this.$store.dispatch('actionInput', { inputValue })
      }
    }
  }
}


이 테스트의 목적을 위해서 액션(action)이 무엇인지, 또는 스토어(store)가 어떻게 구성 되어 있는지 신경 쓸 필요가 없습니다. 우리는 단지 액션이 필요할 때 호출되고 있으며, 기대한 값으로 호출된 것을 확인해야합니다.
이 테스트에서 얕은(shallow) 스토어에 목킹된 스토어를 전달해야합니다.
저장소를 베이스 Vue 생성자에 전달하는 대신 localVue에 전달할 수 있습니다. localVue는 글로벌 Vue 생성자에 영향을 미치지 않고, 변경할 수 있는 범위가 지정된 Vue 생성자입니다.
어떻게 구성되었는지 보겠습니다.
import { shallow, createLocalVue } from 'vue-test-utils'
import Vuex from 'vuex'
import Actions from '../../../src/components/Actions'

const localVue = createLocalVue()

localVue.use(Vuex)

describe('Actions.vue', () => {
  let actions
  let store

  beforeEach(() => {
    actions = {
      actionClick: jest.fn(),
      actionInput: jest.fn()
    }
    store = new Vuex.Store({
      state: {},
      actions
    })
  })

  it('calls store action actionInput when input value is input and an input event is fired', () => {
    const wrapper = shallow(Actions, { store, localVue })
    const input = wrapper.find('input')
    input.element.value = 'input'
    input.trigger('input')
    expect(actions.actionInput).toHaveBeenCalled()
  })

  it('does not call store action actionInput when input value is not input and an input event is fired', () => {
    const wrapper = shallow(Actions, { store, localVue })
    const input = wrapper.find('input')
    input.element.value = 'not input'
    input.trigger('input')
    expect(actions.actionInput).not.toHaveBeenCalled()
  })

  it('calls store action actionClick when button is clicked', () => {
    const wrapper = shallow(Actions, { store, localVue })
    wrapper.find('button').trigger('click')
    expect(actions.actionClick).toHaveBeenCalled()
  })
})

여기서 무슨일이 일어나고 있을까요? 첫째로 Vue에게 Vue.use 메소드로 Vuex를 사용하도록 지시합니다. 이는 Vue.use에 대한 래퍼일 뿐입니다.
다음 가짜 값과 함께 Vuex.store를 호출하여 목킹 스토어를 만듭니다. 우리가 지금 신경써야 할 액션만 전달합니다.
액션은 jest 목킹 함수입니다. 목킹 함수는 액션이 호출되었는지 아닌지를 검증하는 메소드를 제공합니다.
그런 다음, 우리는 테스트에서 액션 스텁이 예상한 시점에 호출되었는지 검증할 수 있습니다.
여기에서 이러한 스토어를 정의하는 방식이 조금 어색할 수 있습니다.
beforeEach를 사용하여, 각 테스트 전에 깨끗한 스토어를 보장 하도록 합니다. beforeEach는 각 테스트 전에 호출되는 Mocha 훅입니다. 이 테스트에서는 스토어 변수에 값을 다시 지정합니다. 이렇게 하지 않으면, 목킹 함수를 자동으로 재설정해 주어야 합니다. 물론 테스트에서 상태(state)를 바꿀 수 있습니다만, 이 방법이 다음에 진행되는 테스트들에 영향을 주지 않는 방법입니다.
테스트에서 가장 주의깊게 봐야할 부분은 가짜 Vuex 스토어를 만든 다음, 이를 vue-test-utils에 전달하는 것 입니다.
이제 액션을 목킹할 수 있습니다. getters를 목킹해보겠습니다.
게터 목킹하기


      {{inputValue}}
      {{clicks}}




import { mapGetters } from 'vuex'

export default{
  computed: mapGetters([
    'clicks',
    'inputValue'
  ])
}


아주 간단한 컴포넌트입니다. 게터는 clicks와 inputValue의 결과를 렌더링합니다. 다시 말하지만, 우리는 단지 결과가 올바르게 렌더링 되는 것 외에 게터가 반환하는 것을 신경쓰지 않습니다.
